import React from "react";
import { List, ListItemButton, ListItemText, Typography } from "@mui/material"
import style from './SolicitaServico.module.scss';
import { Box } from "@mui/system";

export const SolicitaServico = () => {

    const [selectedIndex, setSelectedIndex] = React.useState(1);

    const servicos = [
        {
            title: "Impressão do CRLVe",
            id: 0,
        },
        {
            title: "Emissão de Certidão",
            id: 1,
        },
        {
            title: "Baixa simples do Veículo",
            id: 2,
        },
        {
            title: "Solicitação de Vistoria",
            id: 3,
        },
        {
            title: "Transferência de propriedade de Veìculo de Outra UF",
            id: 4,
        },
        {
            title: "Primeiro Emplacamento",
            id: 5,
        },

    ]

    const handleListItemClick = (event, index) => {
        setSelectedIndex(index);
    };

    return (
        <>
            <Typography variant='h6'>Selecione o serviço desejado</Typography>
            <div className={style.opcoes}>
                <Box sx={{ width: '100%', bgcolor: 'background.paper' }}>
                    <nav aria-label="secondary mailbox folders">
                        <List component="nav" aria-label="secondary mailbox folder" sx={{display: 'flex', flexWrap: 'wrap'}}>
                            {servicos.map((itens) => (
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === itens.id}
                                onClick={(e) => handleListItemClick(e, itens.id)}
                            >
                                <ListItemText primary={itens.title} align='center' />
                            </ListItemButton>
                            ))}
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === 2}
                                onClick={(e) => handleListItemClick(e, 2)}
                            >
                                <ListItemText primary="Impressão do CRLVe" align='center' />
                            </ListItemButton>
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === 3}
                                onClick={(e) => handleListItemClick(e, 3)}
                            >
                                <ListItemText primary="Emissão de Certidão" align='center' />
                            </ListItemButton>
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === 4}
                                onClick={(e) => handleListItemClick(e, 4)}
                            >
                                <ListItemText primary="Baixa simples do Veículo" align='center' />
                            </ListItemButton>
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === 5}
                                onClick={(e) => handleListItemClick(e, 5)}
                            >
                                <ListItemText primary="Solicitação de Vistoria" align='center' />
                            </ListItemButton>
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === 6}
                                onClick={(e) => handleListItemClick(e, 6)}
                            >
                                <ListItemText primary="Transferência de propriedade de Veìculo de Outra UF" align='center' />
                            </ListItemButton>
                            <ListItemButton
                                sx={{minWidth: '25%'}}
                                selected={selectedIndex === 7}
                                onClick={(e) => handleListItemClick(e, 7)}
                            >
                                <ListItemText primary="Primeiro Emplacamento" align='center' />
                            </ListItemButton>
                        </List>
                    </nav>
                </Box>
            </div>
        </>
    )
}
